const duplicatesMemo = {};

const hasDuplicates = function(stringToCheck)
{
    if(duplicatesMemo[stringToCheck])
        return true;
    else
    {
        let chars = stringToCheck.split("");
        let charsDict = {};
        for (let i = 0; i < chars.length; i++) {
            const characterToFind = chars[i];
            if(charsDict[characterToFind])
                return true;
            else
                charsDict[characterToFind] = true;
        }
        return false;
    }
};

function longestSubstring(s) {

    if(s === "")
    {
        return "";
    }
    if(s.length === 1)
    {
        return s;
    }
    else {
        if(!hasDuplicates(s))
        {
            return s;
        }
        else
        {
            let start = 0;
            let end = s.length;
            let longestUnique = "";


            while(start < s.length)
            {
                for (let i = end; i >= start; i--) {
                    const searchSubString = s.substring(start, i);
                    if(!hasDuplicates(searchSubString) && searchSubString.length > longestUnique.length)
                    {
                        longestUnique = searchSubString;
                    }
                }
                start++;
            }

            return longestUnique;
        }
    }
}

function lengthOfLongestSubstring(s) {
    const longest = longestSubstring(s);
    // console.log(`for string ${s}, longest substring is ${longest} with a length of ${longest.length}`);
    return longest.length;
}

